import React, { useState, useEffect } from "react";
import axios from "axios";
import { useParams } from "react-router-dom";

const EventDetails = () => {
  const { eventId } = useParams();
  const [event, setEvent] = useState(null);
  const [userId, setUserId] = useState(null);
  const [error, setError] = useState("");
  const [message, setMessage] = useState("");
  const [isRSVPed, setIsRSVPed] = useState(false);

  useEffect(() => {
    const storedUserId = localStorage.getItem("userId");
    if (storedUserId && storedUserId !== "undefined") {
      setUserId(storedUserId);
    }
  }, []);

  useEffect(() => {
    const fetchEventDetails = async () => {
      if (!eventId) {
        setError("Invalid event ID.");
        return;
      }

      try {
        const response = await axios.get(`http://localhost:5000/events/${eventId}`);
        setEvent(response.data);

        if (userId) {
          const rsvpStatus = await axios.get(
            `http://localhost:5000/rsvp/status/${eventId}/${userId}`
          );
          setIsRSVPed(rsvpStatus.data?.isRSVPed || false);
        }
      } catch (err) {
        console.error("Error loading event:", err);
        setError("Failed to load event details.");
      }
    };

    fetchEventDetails();
  }, [eventId, userId]);

  const handleRSVP = async () => {
    try {
      const res = await axios.post("http://localhost:5000/rsvp", { eventId, userId });
      setMessage(res.data.message || "RSVP successful!");
      setIsRSVPed(true);
    } catch (err) {
      setMessage(err.response?.data?.message || "Failed to RSVP.");
    }
  };

  const handleCancelRSVP = async () => {
    try {
      const res = await axios.post("http://localhost:5000/cancel-rsvp", { eventId, userId });
      setMessage(res.data.message || "RSVP cancelled.");
      setIsRSVPed(false);
    } catch (err) {
      setMessage(err.response?.data?.message || "Failed to cancel RSVP.");
    }
  };

  if (error) return <div style={{ color: "red" }}>{error}</div>;
  if (!event) return <div>Loading event details...</div>;

  return (
    <div className="event-details" style={{ padding: "20px", maxWidth: "600px", margin: "0 auto" }}>
      <h2>{event.title}</h2>
      <p>{event.description}</p>
      <p><strong>Date:</strong> {new Date(event.date).toLocaleString()}</p>
      <p><strong>Location:</strong> {event.location}</p>
      <p><strong>Ticket Type:</strong> {event.ticket_type}</p>
      <p><strong>Tickets Available:</strong> {event.ticket_availability}</p>

      <div style={{ marginTop: "20px" }}>
        {userId ? (
          isRSVPed ? (
            <button onClick={handleCancelRSVP} style={{ backgroundColor: "red", color: "white", padding: "8px 16px", border: "none", borderRadius: "5px" }}>
              Cancel RSVP
            </button>
          ) : (
            <button onClick={handleRSVP} style={{ backgroundColor: "green", color: "white", padding: "8px 16px", border: "none", borderRadius: "5px" }}>
              RSVP
            </button>
          )
        ) : (
          <p style={{ color: "orange" }}>Login to RSVP.</p>
        )}
      </div>

      {message && <p style={{ color: "blue", marginTop: "10px" }}>{message}</p>}
    </div>
  );
};

export default EventDetails;
